import { Paper, Typography, Box } from '@mui/material';
import { styled } from '@mui/system';
// import { AppbarHeight } from '../../library/common/constants';

export const CssCard = styled(Box)(({ theme }) => ({
   cursor: 'pointer',
   zIndex: 100,
   boxShadow: '0px 4px 6px rgba(54, 78, 126, 0.101545)',
}));
CssCard.defaultProps = {
   py: 3,
   px: 2,
};
